    description: "",
    duration: 0,
    date: new Date(),
    users: []
  })

  const onSubmit = (e) => {
    e.preventDefault()

    const exercise = {
      username: exerciseState.username,
      description: exerciseState.description,
      duration: exerciseState.duration,
      date: exerciseState.date
    }
    console.log(exercise)
    window.location = "/"
  }

  return (
    <div>
      <form>
